import React from 'react'
import { Itemsappear } from '../../redux/actions/ReduxActions'

function Stars({ stars, setStars }) {
  var ss = Itemsappears.map((number) => number.rate)
  return (
    <div>
      {[1, 2, 3, 4, 5].map((star) => {
        return (
          <span
            className='start'
            style={{
              cursor: 'pointer',
              color: stars >= star ? 'gold' : 'gray',
              fontSize: `35px`,
            }}
            onClick={() => {
              setStars(star)
            }}
          >
            {' '}
            ★{' '}
          </span>
        )
      })}
    </div>
  )
}

export default Stars;
